import React from 'react'

const Sidebtn = (props: any) => {
    return (
        <button className="z-30 text-2xl border-s-2 w-full py-2 hover:bg-gray-200">
            {props.text}
        </button>
    )
}


const SideBar = (props: any) => {
  return (
    <div className="absolute rounded-lg right-0 h-full w-3/4 bg-red-500">
        <ul className="flex flex-col">
            {(
                <>
                    <Sidebtn text="Scopri"/>
                    <Sidebtn text="Recensioni"/>
                    <Sidebtn text="Classifiche"/>
                </>
            )}
        </ul>
    </div>
  )
}

export default SideBar
